```csharp
[FunctionName("VariableObserver")]
public static async Task VariableObserver([OrchestrationTrigger] IDurableOrchestrationContext context)
{
    var variableValue = context.GetInput<int>();

    if (variableValue == 0)
    {
        // Variable is 0, wait for it to become 1
        var event1 = await context.WaitForExternalEvent<int>("VariableChanged");
        if (event1 == 1)
        {
            // Variable became 1, wait for it to become 0
            var event2 = await context.WaitForExternalEvent<int>("VariableChanged");
            if (event2 == 0)
            {
                // Variable became 0, end function
                return;
            }
        }
    }
    else if (variableValue == 1)
    {
        // Variable is 1, wait for it to become 0 or 10 minutes to pass
        var event2 = await context.WaitForExternalEvent<int>("VariableChanged");
        if (event2 == 0)
        {
            // Variable became 0, end function
            return;
        }
    }

    // 10 minutes passed, end function
}

[FunctionName("VariableChanged")]
public static void VariableChanged([ActivityTrigger] IDurableActivityContext context, int newValue)
{
    context.ContinueAsNew(newValue);
}
```

This function waits for an external event called "VariableChanged" which will contain the new value of the variable. It waits for the variable to change from 0 to 1, then 1 to 0, or 10 minutes to pass. The VariableChanged function simply continues the orchestration with the new variable value.
